/**
 * Created by Lenovo on 2019/8/10.
 */
import React from 'react';
import './register.css';
import {Title,List} from '../../share';
import {getData, goNext} from '../../utils';
const Item = List.Item;
export default class Register extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            account: '',
            password: '',
        }
    }
    componentDidMount(){
        //console.log(this);
    }
    goBack(){
        goNext(this,'app',3)
    }
    render() {
        return<div>
            <Title  onLeftClick={()=>this.goBack()} title="注册"/>
            <div className="cm-mlr-15">
                <List
                    Item
                   leftTitle = "昵称"
                   rightTitle = "请输入昵称"
                />
                
                <List
                    leftTitle = "昵称"
                    rightTitle = "请输入昵称"
                />
                <List
                    leftTitle = "昵称"
                    rightTitle = "请输入昵称"
                />
                <div className="cm-tx-c">
                    <span className="cm-btn-small login-mt-40">注册</span>
                </div>
                <div className="cm-tx-r login-operate">
                   已有账户？登录
                </div>
            </div>
        </div>
    }
}
